import {McbError} from "./McbError.js"
import {Register} from "../../genes/Register.js"

const $global = Register.$global

export const LibraryError = Register.global("$hxClasses")["mcl.error.LibraryError"] = 
class LibraryError extends Register.inherits(McbError) {
	new(message) {
		super.new("Library Error:\n\t" + message, []);
	}
	static get __name__() {
		return "mcl.error.LibraryError"
	}
	static get __super__() {
		return McbError
	}
	get __class__() {
		return LibraryError
	}
}

